import { newItemDate } from './NewitemDate';
import { NewItemCard } from './NewItemCard';

export const NewitemList = () => {
  return (
    <div>
      {newItemDate.map((item) => (
        <NewItemCard key={item.id} item={item} />
      ))}
    </div>
  );
};
